import React from "react"

let Listuser = (props) => {
    return (
        <div className='boxList'>
        <div className='users '>
              {props.l ? (
                    props.data.map((item) => {
                          return (
                          <div className='user border-bottom'>
                                <img className='img-avatar' src={item.img} />
                                <div className='px-3'>
                                      <p className='d-inline fs-5'> {item.name} </p>
                                      <p className='fs-6'> {item.data} </p>
                                </div>
                          </div>
                          )
                    })
              ) : <h2 className='message'>لا توجد مواعد اليوم</h2>}
        </div>
  </div>
    )
}

export default Listuser
